import { Alert, Card, Container } from "@mui/material";
import Layout from "../components/layout/Layout";

const NotFoundPage = () => {
    return (
        <Layout>
            <Alert severity="error">
                Page not found!
            </Alert>
        </Layout>
    )
};

export default NotFoundPage;
